      'description': {'_content': 'Taking the cable car up to Ocean Park. This provided an example of Chinese xenophobia; we were bundled by staff into a car already containing several Chinese. These babbled constantly all the way up, and I did catch the word &quot;gwaelo&quot;, meaning &quot;foreign devil&quot;. On arriving at the summit and stepping out, my friend, who had said nothing, came back at them with a torrent of abusive Cantonese, having completed the long language course in Lymeun, Hong Kong. They were devastated, and suffered a great loss of face.\n\nThe park was opened in 1977 and is a big tourist attraction. I managed a day off and visited a friend who was on a two year posting to Hong Kong, and who showed me the sights. All work and no play!\n\nTaken during an Op Culex tour in late 1980. Op Culex was the name for support of the Hong Kong government in stemming the tide of illegal immigrants from the People\'s Republic of China. This was a Sisyphean task until the HK government ended the policy of granting residence permits to those who managed to make it to HK Island. Numbers dropped dramatically after that.'},
