      'ispublic': 1,
      'isfriend': 0,
      'isfamily': 0,
      'license': '0',
      'description': {'_content': 'The Dujiangyan Panda Base and Center for Disease Control, operated by the Conservation and Research Center for the Giant Pandas (CCRCGP), occupies a semi-natural hillside location near Shiqiao Village, Qingchengshan in Dujiangyan county, near the Taoist holy mountain of Q\u012bngch\u00e9ngsh\u0101n and 18 km from central Dujiangyan city. \n\nA more visitor-friendly name is <em>\'Dujiangyan Giant Panda Base\'<\/em>; it also seems to be known as <em>\'Dujiangyan Panda Ark\'<\/em>.\n\nThe 51 ha centre (or is that just the visitor-accessible part?) has a specific focus on panda disease control, prevention and research. As such, the \'nursing home\' works with sick or injured wild pandas and elderly or disabled captive pandas.\nThis doesn\'t mean that all the residents are ill or otherwise disabled &ndash; I wasn\'t aware of seeing any in such a condition. Many are entirely healthy, as the CCRCGP\'s disease-prevention initiative involves separating captive populations, containing any outbreaks to individual bases, and veterinary research also needs to study healthy individuals.\n\nIt also acts as quarantine for pandas leaving or entering China; if you\'ve seen giant pandas anywhere else in the world, they either visited or will visit Dujiangyan Panda Base at some point, as the foreign-born cubs of Chinese-loaned pandas (i.e. all of them!) contractually must be returned to China and the breeding programme.\nThat may explain the grid on this manhole cover, suggesting latitude\/longitude lines on a globe.\n\nThe world-famous Chengdu Panda Base (Chengdu Research Base of Giant Panda Breeding, CRBGPB) also has a Field Research Center in Dujiangyan county, seemingly known as Dujiangyan Panda <em>Valley<\/em>, where pandas are gradually reintroduced to the wild.  To avoid misunderstanding: this isn\'t it.'},
